v.x:
var $bm_rt;
var txt;
$bm_rt = txt = thisComp.layer('stars').text.sourceText;
if (!isNaN(parseFloat(txt)))
    $bm_rt = parseFloat(txt);
else
    $bm_rt = value;

s.x:
var $bm_rt;
var s;
s = $bm_mul(Math.min(1, $bm_div(555, thisLayer.sourceRectAtTime().width)), 100);
$bm_rt = [
    s,
    s
];

var $bm_rt;
var x, w, resize;
x = thisLayer.sourceRectAtTime() ? thisLayer.sourceRectAtTime().width : 0;
w = 555;
$bm_rt = resize = $bm_mul($bm_div(w, x), 100);
if (x > w)
    $bm_rt = [
        resize,
        resize
    ];
else
    $bm_rt = [
        100,
        100
    ];

y.x:
var $bm_rt;
var n, h;
n = thisComp.layer('review text');
h = n.sourceRectAtTime() ? n.sourceRectAtTime().height : 0;
$bm_rt = $bm_sum(value, $bm_div(h, 2));

s.x:
var $bm_rt;
var n, h;
n = thisComp.layer('review text');
h = n.sourceRectAtTime() ? n.sourceRectAtTime().height : 0;
$bm_rt = [
    value[0],
    270 + h
];
